        var matched = new bool[M];
        var pairs = new List<(int, int)>(M/2);

        if (!MatchTranslators(0, matched, pairs, adjacencyList, M))
        {
            Console.WriteLine("impossible");
            return;
        }

        foreach (var (a, b) in pairs)
        {
            Console.WriteLine($"{a} {b}");
        }
    }

    private static bool MatchTranslators(int current, bool[] matched, 
        List<(int, int)> pairs, HashSet<int>[] adjacencyList, int M)
    {
        while (current < M && matched[current])
        {
            current++;
        }

        if (current >= M)
        {
            return pairs.Count == M / 2;
        }

        matched[current] = true;
        foreach (int next in adjacencyList[current])
        {
            if (!matched[next])
            {
                matched[next] = true;
                pairs.Add((current, next));

                if (MatchTranslators(current + 1, matched, pairs, adjacencyList, M))
                {
                    return true;
                }

                pairs.RemoveAt(pairs.Count - 1);
                matched[next] = false;
            }
        }
        matched[current] = false;

        return false;
    }
}

